import React from 'react'
import fire from './img/Group 96.svg';
export default function NavbarCard() {
  return (
    <div>
        <div className="row">
                <div className="col-1 card">
                    <img className='card-img-top' src={fire} alt="foto" />
                    <a className="nav-link text-align-center" href="#">Акции</a>
                </div>
        </div>
    </div>
  )
}
